import React from "react";
import css from "../Friends.module.css";

export function AllPages(pages, currentPage, setPage) {
  return <div className={css.numbers}>
    {pages.map((p) => {
      return (
        <text
          className={currentPage === p ? `${css.item} ${css.activePage}` : css.item}
          onClick={() => {
            setPage(p);
          }}
        >
          {p}
        </text>
      );
    })}
  </div>;
}
